import React from 'react';
import {Row, Col} from "reactstrap";
import App from './App';


const Footer = () => {
    const thisYear = () => {
        const year = new Date().getFullYear();
        return year
    };
    const style = {
		color: "black",
        align: "center", 
		backgroundColor: "grey"
	}

    return (
        <div style = {style}> 
            <Row>
                <Col>
                    <p>
                        Copyright &copy; <span>{thisYear()}</span>
                    </p>
                </Col>
            </Row>
        </div>
    );
};

export default Footer;
